import React from "react";
export default class Coin extends React.Component{

    constructor(props){
        super(props)
        this.state = {
            error: undefined,
            isLoaded: false,
            coins : []
        }
        this.getData = this.getData.bind(this);
    }
   componentDidMount(){
     this.getData();
    }
    getData () {
        let headersList = {
            "mode":"no-cors",
            "Accept": "*/*",
            "Authorization": "Bearer eyJhbGciOiJIUzI1NiJ9.eyJzdWIiOiJWTjA1MTA5OCIsImV4cCI6MTY1MTUzMjAwOSwiaWF0IjoxNjUxNDk2MDA5fQ.4nqLo5GL-lLink9MFcVNsq2Fj_VrAW-bbac-UR8WDLI"
           }
       fetch("http://localhost:8089/api/coin/getAllCoin", { 
             method: "GET",
             headers: headersList
           }).then(function(response) {
             return response.text();
           }).then(function(data) {
             console.log(data);
           })
        }
      
    render(){
        return (
            <div> 
            <h1>Coin List</h1>  
                <table className="table table-hover">
                    <thead>
                        <tr>
                            <th>CoinId</th>
                            <th>CoinName</th>
                            <th>Price</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                        this.state.coins.map(
                        coin =>
                        <tr key = {coin.coinId}>
                            <td>{coin.coinId}</td>
                            <td>{coin.coinName}</td>
                            <td>{coin.price}</td>
                        </tr>
                            )
                        }
                    </tbody>
            </table>
   </div>

        )
       
    }
}
